import React from 'react'; 
import { Link } from 'react-router-dom'; 

function Header(props) {
  const [isOpenMenu, setIsOpenMenu] = React.useState(false);

  function handleClickMenu() {
    setIsOpenMenu(!isOpenMenu);
  }

  return (
    <header className="header page__header">
      <Link to="/" className="header__logo" />
      <div className={`header__container header__container_active`}>
        <p className="header__login">123@mail.ru</p>
        <button className="header__logout-button">Выйти</button>
      </div>
      <button className="header__menu-button" onClick={handleClickMenu}></button>
    </header>
  );
}

export default Header;
